let cursorEventFlag;
let cursorRect = null;
let seatRect;

export default class ScreenModal extends React.PureComponent {
  static propTypes = {
    seats: PropTypes.arrayOf(PropTypes.object).isRequired,
    onScreenChanged: PropTypes.func,
  }
  static defaultProps = {
    onScreenChanged: () => {},
  }


  constructor() {
    super()
    this.state = {
      selectedSeats: [],
    }
  }

  handleOpen = () => {
    this.setState({
      selectedRegion: null
    })
  }

  handleActionClick = () => {
    this.props.onCinemaChanged(this.state.selectedCinemas)
  }


  getSelectedSeats = (isExist, cinemaCode) => {


  }

  renderTriggerButton() {
    return (
      <UI.Button color="teal" fluid circular>
        {_.isEmpty(this.props.selectedSeats) ? " " : " "}
      </UI.Button>
    )
  }

  renderContent() {

    return (
      <UI.Modal.Content>
        <UI.Modal.Description>

        </UI.Modal.Description>
      </UI.Modal.Content>
    )
  }


  drawKonva(container) {
    let Seat = SeatInfo.Items;
    let maxx = 0, maxy = 0, minx = 999999, miny = 999999;
    for(let i=0;i<Seat.length;i++){
      Seat[i].SeatXCoordinate /= 20;
      Seat[i].SeatYCoordinate /= 20;
      Seat[i].SeatXLength /= 20;
      Seat[i].SeatYLength /= 20;
      if(maxx < Seat[i].SeatXCoordinate)  maxx = Seat[i].SeatXCoordinate;
      if(maxy < Seat[i].SeatYCoordinate)  maxy = Seat[i].SeatYCoordinate;
      if(minx > Seat[i].SeatXCoordinate)  minx = Seat[i].SeatXCoordinate;
      if(miny > Seat[i].SeatYCoordinate)  miny = Seat[i].SeatYCoordinate;
    }
    let correctionY = miny - 50;

    let stage = new Konva.Stage({
      container: container,
      width: maxx + minx + 100,
      height: maxy + miny + 50,
    });

    let layer = new Konva.Layer();
    layer.add(new Konva.Rect({x: minx,
      y: 10,
      width: maxx - minx + Seat[0].SeatXLength,
      height:20,
      fill: 'black',
      stroke: 'black'}));

    seatRect = [];
    for(let i=0;i<Seat.length;i++){
      Seat[i].SeatYCoordinate -= correctionY
      seatRect.push(new Konva.Rect({
        x: Seat[i].SeatXCoordinate,
        y: Seat[i].SeatYCoordinate,
        width: Seat[i].SeatXLength,
        height:Seat[i].SeatYLength,
        SeatNo: Seat[i].SeatNo,
        Selected: false,
        fill: 'white',
        stroke: 'black',
        strokeWidth: 2}));
      layer.add(seatRect[i]);
    }

    stage.on('mousedown', (e) => {
      if(cursorRect != null)  cursorRect.destroy();
      cursorEventFlag = true;
      cursorRect = new Konva.Rect({
        x: e.evt.layerX,
        y: e.evt.layerY,
        width: 1,
        height:1,
        stroke: 'red',
        strokeWidth: 2,
      });
      layer.add(cursorRect);
      stage.draw();
    });
    stage.on('mousemove', (e) => {
      if(cursorEventFlag){
        cursorRect.attrs.width = e.evt.layerX - cursorRect.attrs.x;
        cursorRect.attrs.height = e.evt.layerY - cursorRect.attrs.y;
        stage.draw();
      }
    });
    stage.on('mouseup', (e) => {
      if(cursorRect != null){
        var r = cursorRect.attrs;
        for(var i=0;i<seatRect.length;i++){
          var s = seatRect[i].attrs;
          if(r.x <= s.x && r.y <= s.y && (r.x+r.width) >= (s.x+s.width) && (r.y+r.height) >= (s.y+s.height)){
            seatRect[i].attrs.fill = 'red';
            seatRect[i].Selected = true;
          }
          else{
            seatRect[i].attrs.fill = 'white';
            seatRect[i].Selected = false;
          }
        }
        cursorRect.destroy();
      }
      cursorEventFlag = false;
      stage.draw();
    });

    stage.add(layer);
  }


  render() {

    //const {screens} = this.props;

    return (
      <Form>
        <Segment stacked>
          <div ref={ref => this.drawKonva(ref)} />
        </Segment>
        <Button icon='angle left' floated='left'/>
        <Button icon='angle right' floated='right'/>

      </Form>
    );
  }

}
